import React from 'react';
import { useSelector } from 'react-redux';
import {
    YoutubeIconStyled,
    TwitterIconStyled,
    RedditIconStyled
} from './media-icon.styles';

const MediaIcon = () => {
    const { mediaPref } = useSelector(state => state.userReducer);
    switch (mediaPref) {
        case 'Youtube':
            return (
                <RedditIconStyled />
            )
        default:
            return (
                <YoutubeIconStyled />
            )
    }
}

export default MediaIcon;
